import React from "react";
import Yourwayimage from "../assets/way.png";

export default function Yourway({ onPageChange }) {
  const handleContinue = () => {
    onPageChange();
  };

  return (
    <div
      style={{
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        width: "80%",
        margin: "auto",
      }}
    >
      <div className="flex flex-col items-center mt-8 lg:flex-row lg:justify-center">
        <img
          src={Yourwayimage}
          alt="Math Comfort"
          className="mb-4 lg:mr-8 lg:mb-0 lg:w-2/5 lg:h-auto"
        />
        <div className="text-center lg:text-left lg:">
          <h1 className="mb-2 text-xl font-bold">You're on your way!</h1>
          <div className="flex items-center justify-center lg:justify-start mb-2">
            {Array.from({ length: 5 }).map((_, index) => (
              <span key={index} role="img" aria-label="star">
                ⭐️
              </span>
            ))}
          </div>
          <p className="lg:w-96">
            “Through its engaging and well-structured courses, Brilliant has
            taught me mathematical concepts that I previously struggled to
            understand. I now feel confident approaching both technical job
            interviews and real-world problem-solving situations.”
          </p>
          <p>- Jacob S.</p>
        </div>
      </div>
      <div style={{ textAlign: "center", marginTop: "20px" }}>
        <button
          onClick={handleContinue}
          style={{
            padding: "8px 26px",
            backgroundColor: "black",
            color: "white",
            border: "1px solid #ccc",
            borderRadius: "5px",
            cursor: "pointer",
          }}
        >
          Continue
        </button>
      </div>
    </div>
  );
}
